import React from "react";
import Main from "./components/main/Main";
import Footer from "./components/footer/Footer";
import Header from "./components/header/Header";

import { GlobalStyle } from "./GlobalStyle";

function App() {
  return (
    <div>
      <GlobalStyle/>
      <HomePage/>
      <BarraNavegacao/>
      <Carrinho/>
      <Footer/>
      <Header/>
    </div>
  );
}

export default App;
